import React from "react";
import { View, Text, Image, TextInput, TouchableOpacity } from "react-native";
import { Ionicons, FontAwesome, AntDesign } from "@expo/vector-icons";

export default function Home(params) {
    return (
      <View
        style={{
          backgroundColor: "white",
          flex: 1,
          paddingTop: 55,
          paddingHorizontal: 20,
        }}
      >
        <View
          style={{
            flexDirection: "row",
            justifyContent: "space-between",
            alignItems: "center",
          }}
        >
          <Ionicons name="menu" size={24} color="black" />
          <FontAwesome name="motorcycle" size={24} color="black" />
          <View style={{ flexDirection: "row", justifyContent: "space-between"}}>
            <AntDesign name="search1" size={20} color="black" />
            <Ionicons name="notifications-outline" size={20} color="black" />
          </View>
        </View>
        <View style={{flexDirection: "row", justifyContent: "space-between", alignItems: "center",}}>
          <View style={{
            flexDirection: "row",
          }}>
            <Text style ={{ fontSize: 20, fontWeight: 'bold', paddingVertical: 10, alignItems: "left"}}>Top Selling</Text>
          </View>
          <View style={{
            flexDirection: "row",
          }}>
          
          <TouchableOpacity
          onPress={() => {
            navigation.navigate("Home");
          }}
          style={{
            textAlign: "center",
            padding: 10,
            height: 40,
            paddingHorizontal: 115,
            marginTop: 20,
            alignItems: "center",
            borderRadius: 10,
            flexDirection: "row",
            backgroundColor: "white",
          }}
        >
          {/* <AntDesign name="google" size={24} color="white" /> */}
          <Text style={{ fontSize: 15, paddingLeft: 10, color: "white", fontWeight: "bold" }}>See All</Text>
          <MaterialIcons name="navigate-next" size={24} color="white" />
        </TouchableOpacity>
          {/* <Text style ={{ fontSize: 15, paddingVertical: 10, alignSelf: "flex-end"}}>See All</Text> */}
          </View>
        </View>
      </View>
    );
  }
